public static boolean contains(@Nonnull Item item) {
    ItemDeletion instance = instance();
    if (instance == null) {
        return false;
    }
    instance.lock.readLock().lock();
    try {
        return instance._contains(item);
    } finally {
        instance.lock.readLock().unlock();
    }
}

